import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Users() {
    // ... [Your existing states and useEffect]

    const deleteUserHandler = async (userId) => {
        try {
            await axios.delete(`http://localhost:3001/users/${userId}`);
            fetchUsers();
        } catch (error) {
            console.error("Error deleting user", error);
        }
    };

    // ... [Your existing CSS styles]

    const tableStyle = {
        width: '100%',
        borderCollapse: 'collapse',
        fontSize: '18px',
    };

    const tableHeaderStyle = {
        borderBottom: '2px solid #3498db',
    };

    const tableCellStyle = {
        padding: '10px',
        borderBottom: '1px solid #ccc',
    };

    return (
        <div>
            {/* ... [Your existing add user inputs] */}

            <h3 style={titleStyle}>Existing Users</h3>
            <table style={tableStyle}>
                <thead>
                    <tr style={tableHeaderStyle}>
                        <th style={tableCellStyle}>Username</th>
                        <th style={tableCellStyle}>First Name</th>
                        <th style={tableCellStyle}>Last Name</th>
                        <th style={tableCellStyle}>Date of Birth</th>
                        <th style={tableCellStyle}>Email</th>
                        <th style={tableCellStyle}>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td style={tableCellStyle}>{user.username}</td>
                            <td style={tableCellStyle}>{user.firstName}</td>
                            <td style={tableCellStyle}>{user.lastName}</td>
                            <td style={tableCellStyle}>{user.dateOfBirth}</td>
                            <td style={tableCellStyle}>{user.email}</td>
                            <td style={tableCellStyle}>
                                <button style={buttonStyle} onClick={() => deleteUserHandler(user.id)}>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Users;
